import React, { Component } from 'react';
import { Button } from '@material-ui/core';
import home from './home.png'
import './home.css';


class Home extends Component {
    render() {
        return (
            <div>
                <img src={home} width='100%' />
                <br /><br />
                <div class="container-fluid">
                    <div class="row" >
                        <div class="col-lg-5" >

                        </div>

                        <div class="col-lg-2" >
                            <Link href='/Home' >
                                <button id="home" type="button" class="btn btn-primary btn-lg center">เข้าสู่หน้าหลัก</button>
                            </Link>
                        </div>


                        <div class="col-lg-5" >

                        </div>

                    </div>
                </div>

            </div>
        )

    }
}
export default Home;
